import { StyleSheet } from "@react-pdf/renderer";

export const styles = StyleSheet.create({
  page: {
    flexDirection: "column",
    backgroundColor: "#fff",
    fontFamily: "Poppins",
  },
  section: {
    margin: 10,
    padding: 10,
    fontSize: 10,
    justifyContent: "center",
  },
  ///
});
